import React from 'react';


const InfoList = (json) => {
  var array = [];
  for(var i in json) {
    array.push([i, json[i]]);
  }
  return(
    <ul>
      {array.map((pair, key) => (
        <li>{pair[0]}: {pair[1]}</li>
      ))}
    </ul>
  )
}


export default InfoList;
